const { Alchemy, Network, Wallet, Utils } = require("alchemy-sdk");
const dotenv = require("dotenv");

dotenv.config();
const { API_KEY_GOERLI, PRIVATE_KEY } = process.env;

const settings = {
  apiKey: API_KEY_GOERLI,
  network: Network.ETH_GOERLI,
};
const alchemy = new Alchemy(settings);

let wallet = new Wallet(PRIVATE_KEY);


async function main() {
  const nonce = await alchemy.core.getTransactionCount(
    wallet.address,
    "latest"
  );
  for (let i = nonce; i <= nonce + 5; i++) {
    let transaction = {
      to: "0xb15E860b8ecf08B41F3a1832e834a3bEf8cf9EEd",
      value: Utils.parseEther("0"),
      data: "",
      gasLimit: "21000000",
      maxPriorityFeePerGas: Utils.parseUnits("2", "gwei"),
      maxFeePerGas: Utils.parseUnits("2", "gwei"),
      nonce: i,
      type: 2,
      chainId: 5,
    };
    let rawTransaction = await wallet.signTransaction(transaction);
    let tx = await alchemy.core.sendTransaction(rawTransaction);
    console.log("Sent transaction", tx);
  }

}

main();
